import React from "react";
import './App.css';


class LogIn extends React.Component{
    constructor(){
        super()
        this.name,
        this.email,
        this.pswd
    }

    updateName=(x)=>{
        this.setState({
          name : x.target.value 
        })
      }
        updateEmail=(x)=>{
          this.setState({
            email : x.target.value
          })
        }
        updatePswd=(x)=>{
          this.setState({
            pswd : x.target.value
          })
        }

        check=()=>{
           let n= localStorage.getItem("name")
           let e= localStorage.getItem("email")
           let p =  localStorage.getItem("password")

            if(this.state.name != n || this.state.email != e || this.state.pswd != p){
                alert("Check your credintial")
            }
            else {
                alert("Logged In..")
            }
        }

render(){
    return(
        <div>
             <form onSubmit={this.check}>
      <label>Name : </label>
      <input type='text' value={this.state.name} onChange={this.updateName} required></input>
      <br/><br/>
      <label>Email : </label>
      <input type='emial' value={this.state.email }onChange={this.updateEmail} required></input>
      <br/><br/>
      <label>Password : </label>
      <input type='password'value={this.state.pswd} onChange={this.updatePswd} required></input>
      <br/><br/>
      <input type="submit" value={Log-In}></input>
      </form>


        </div>
    )
}


}

export default LogIn;
